import React, { useState } from 'react';
import axios from 'axios';

function FamilyMembers() {
  const [familyMembers, setFamilyMembers] = useState([]);

  function handleDelete(event) {
    const id = event.target.dataset.id;
    axios.delete(`http://localhost:3001/delete/${id}`)
      .then((response) => {
        console.log(response);
        setFamilyMembers(familyMembers.filter(member => member.id !== id));
      })
      .catch((error) => {
        console.log(error);
      });
  }

  function handleClick() {
    axios.get('http://localhost:3001/get')
      .then((response) => {
        setFamilyMembers(response.data);
      })
      .catch((error) => {
        console.log(error);
      })
  };

  function handleSubmit(event) {
    event.preventDefault();
    const form = event.target;
    const member = {
      meno: form.meno.value,
      priezvisko: form.priezvisko.value,
      vek: form.vek.value,
      pribuzenstvo: form.pribuzenstvo.value
    };

    axios.post('http://localhost:3001/create', member)
      .then((response) => {
        console.log(response);
        setFamilyMembers([...familyMembers, response.data]);
      })
      .catch((error) => {
        console.log(error);
      }
    );
    
  }

  return (
    <div className="telostranky">
      <center>
      <div className='formtabulka'>
        <form onSubmit={handleSubmit}>
          <label>
            Meno:
            <input type="text" name="meno" required />
          </label>
          <label>
            Priezvisko:
            <input type="text" name="priezvisko" required />
          </label>
          <label>
            Vek:
            <input type="number" name="vek" required />
          </label>
          <label>
            Príbuzenský vzťah:
            <select name="pribuzenstvo" required>
              <option value="otec">Otec</option>
              <option value="matka">Matka</option>
              <option value="brat">Brat</option>
              <option value="sestra">Sestra</option>
              <option value="syn">Syn</option>
              <option value="dcéra">Dcéra</option>
            </select>
          </label>
          <button type="submit">Pridať člena</button>
        </form>
      </div>
      <div>
      <button type="button" onClick={handleClick}>Zobraziť členov</button>
      <table>
        <thead>
          <tr>
            <th>Meno</th>
            <th>Priezvisko</th>
            <th>Vek</th>
            <th>Príbuzenský vzťah</th>
          </tr>
        </thead>
        <tbody>
          {familyMembers.map((member, index) => (
            <tr key={index}>
              <td>{member.meno}</td>
              <td>{member.priezvisko}</td>
              <td>{member.vek}</td>
              <td>{member.pribuzenstvo}</td>
            </tr>
          ))}
        </tbody>
        </table>
      </div>
      </center>
      <div>
      {familyMembers.map((member, index) => (
  <tr key={index}>
    <td>{member.name}</td>
    <td>{member.surname}</td>
    <td>{member.age}</td>
    <td>{member.relationship}</td>
    <td>
      <button type="button" data-id={member.id} onClick={handleDelete}>Vymazať</button>
    </td>
  </tr>
))}
      </div>
    </div>
  );
}

export default FamilyMembers;
